import axios from 'axios';


function loginUser(email, password) {
    return axios
        .post('/https://nodejs-test-api-blog.herokuapp.com/api/v1/auth', {
            email,
            password,
        })
        .then(res => console.log(res))
        .catch(e => console.log(e))
}
